import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './components/NavBar';
import Portada from './components/Portada';
import QuienSoy from './components/Quiensoy.js'
import Skills from './components/Skills';
import Softwares from './components/CuadroSoftware';
import CrearSoluciones from './components/CrearSoluciones';
import UltimosProyectos from './components/UltimoProyecto';

function App() {
  return (
    <Router>
      <div className="App">
        <NavBar />

        <Skills />
        <Routes>
          <Route path="/" element={<Portada />} />
          <Route path="/quien" element={<QuienSoy />} />
          <Route path="/skills" element={<Skills />} />
          <Route path="/softwares" element={<Softwares />} />
          <Route path="/crear-soluciones" element={<CrearSoluciones />} />
          <Route path="/ultimos-proyectos" element={<UltimosProyectos />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
